import {useState, useEffect} from 'react'
import axios from 'axios'
import {Banner} from './banner'


const App = () => {
  const banner = new Banner('utb')
  const [sections, setSections] = useState([])
  const url = "https://bannerssbregistro.utb.edu.co:8443/StudentRegistrationSsb/ssb/classSearch/get_college"
  useEffect(() => {
    axios
      .get(url)
      .then(response => {
        setSections(response.data)
      })
  }, [])

  return(
    <div>
    <ul>
      {sections.map((section) => <li>section</li>)}
    </ul>
    </div>)
}

export default App;
